class Municipio:
    nombre: str
    provincia: str
    coords: tuple
    propiedades: dict

    def __init__(self, nombre, provincia, coords, *args):
        self.nombre = nombre
        self.provincia = provincia
        self.coords = coords
        self.propiedades = { }

        for arg in args:
            for prop in arg:
                self.propiedades[prop[0]] = prop[1]

    def __str__(self) -> str:
        return self.nombre


